      this.$callClient("C:ContractsMenu:Destroyed");
    },
    onBookEnter() {
      const audio = document.getElementById("book-up");
      audio.pause();
      audio.currentTime = 0;
      audio.play();
    },
    onBookLeave() {
      const audio = document.getElementById("book-down");
      audio.pause();
      audio.currentTime = 0;
      setTimeout(() => audio.play(), 200);
    }
  }
};
